import React from 'react';

function App() {
  return (
    <div>
      <h1>Student List</h1>
      <button id="showStudentsButton">Show Students</button>
      <button id="showByGradeButton">Show by Grade</button>
      <ul id="studentList"></ul>
    </div>
  );
}

export default App;
